import React, {useState} from 'react';
import ReactDOM from 'react-dom';
import Taoanh from "./taoasnav";
import contact from './contacts'

function createCardzz(contact) {
    if (contact.name == lp)
    return (
      <Taoanh
      hinh = {contact.hinh}
       />
    )
}
  function Galerry() {
    return (
        <div>
        {contact.hinh.map(createCardzz)}
        </div>
    )
  }

export default Galerry
